    false,nt"url": null,nt"notes": "LIDAR (Light Detection and Ranging) discrete-return
    point cloud data are available in the American Society for Photogrammetry and Remote
    Sensing (ASPRS) LAS format. The LAS format is a standardized binary format for storing
    3-dimensional point cloud data and point attributes along with header information
    and variable length records specific to the data. Millions of data points are stored
    as a 3-dimensional data cloud as a series of x (longitude), y (latitude) and z (elevation)
    points. A few older projects in this collection are in ASCII format. Please refer
    to http://www.asprs.org/Committee-General/LASer-LAS-File-Format-Exchange-Activities.html
    for additional information.",nt"license_title": null,nt"extras": [{ntt"key":
